import "./App.css";

function App() {
  const name = "Ahmed";
  const email = "ahmedabdi03@hotmail.com";
  const age = 20;

  return (
    <div className="App">
      <div>
      <h1>{name}</h1>
      <h2>{email}</h2>
      <h2>{age}</h2>
      </div>
    </div>
  );
}

export default App;
